import React from 'react';
import styled from "styled-components";
import Navbar from '../Components/NavBar';
import NavCardMenu from '../Components/NavCardMenu';

const Container = styled.div`
  width:100%;

`;

const Yugi = () => {
    return (
    <Container>
        <Navbar />
        <NavCardMenu />
        <h1>Yugi Page</h1>
    </Container>
  );
};

export default Yugi;
